import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <body className = "Body">
      </body>
      <header className="App-header">
        <div>
          <img src= "/welcome.png" />
        </div>
        <img src="/cana.png" className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
